import React, { Component } from 'react';
// import './App.css';

class MovieDetails extends Component {
    constructor(props) {
        super(props);
    }

    _renderMovieDetails() {
        try {
            return (
                <div className="movieDetails">
                    {/* {this.props.item.Title} */}
                </div>
            );
        }
        catch (err) { }
    }

    render() {
        return this._renderMovieDetails()
    }
}

export default (MovieDetails);
